def song_length(length):
    # A short song is under 3 minutes long
    # A medium song is is 3-5 minutes long
    # A long song is anything higher than 5 minutes

    filtered_list = []
    if length == "short":
        for i in range(len(list_length)):
            if list_length[i] < 180:
                index = list_length.index(list_length[i])
                filtered_list.append(index)
        return filtered_list
    if length == "medium":
        for i in range(len(list_length)):
            if list_length[i] >= 180 and list_length[i] < 500:
                index = list_length.index(list_length[i])
                filtered_list.append(index)
        return filtered_list
    if length == "long":
        for i in range(len(list_length)):
            if list_length[i] >= 500 :
                index = list_length.index(list_length[i])
                filtered_list.append(index)
        return filtered_list



