def song_energy(energy):
    #This function takes the input the user gives us of how energetic they want the song to be
    # and takes that and finds songs that fit what the user wants
    #low energy is anything equal to or below 30
    #Medium energy is anything higher than 30 but lower then 70
    #high is anything equal to or higher than 70
    filtered_list = []
    if energy == "low":
        for i in range(len(list_energy)):
            if list_energy[i] <= 30:
                index = list_energy.index(list_energy[i])
                filtered_list.append(index)
        return filtered_list
    if energy == "medium":
        for i in range(len(list_energy)):
            if list_energy[i] > 30 and list_energy[i] < 70:
                index = list_energy.index(list_energy[i])
                filtered_list.append(index)
        return filtered_list
    if energy == "high":
        for i in range(len(list_energy)):
            if list_energy[i] >= 70:
                index = list_energy.index(list_energy[i])
                filtered_list.append(index)
        return filtered_list



